import React from 'react'
import Mouse from './assets/mouse.png'

const DummyProduct = [
    {
        title: 'Mouse',
        price: '500.000',
        stock: '600',
        img: './assets/mouse.png',
    },

    {
        title: 'Keyboard',
        price: '700.000',
        stock: '600',
        img: './assets/keyboard.png',
    },

    {
        title: 'Keyboard',
        price: '700.000',
        stock: '600',
        img: './assets/keyboard.png',
    },
];

export default DummyProduct
